import FiltersBar from "./FiltersBar";
import ProductsGrid from "./ProductsGrid";
import './products.css' ;

function MainGrid(props){

  document.querySelector('.MainGrid').addEventListener('load',()=>{
    document.querySelector(".App").scrollTo(document.querySelector(".App").scrollTop);
  })
  return(<div className="MainGrid">
    <FiltersBar/>
    <ProductsGrid changePage={props.changePage}/>
  </div>)
}

export default MainGrid;
